import React, {useState} from 'react';
import '../styles/navbar.css';
import Logo from "../components/Logo.js"

function Navbar() {

    return ( 
        <>
            <Nav>
                <NavLink to="/">
                    <Logo/>
                </NavLink>
            </Nav>
        </>
     );
}

export default Navbar;
